import React from 'react'
import './projects.css'

function projects({img,link,xd,alt}) {
  return (
    <div className='project-card'>
        <a href={link}>
            <img src={img} alt={alt}/>
        </a>
        <a href={xd}>Adobe XD link</a>
        {console.log(img)}
    </div>
  )
}

export default projects
